import Buttons from "../elements/Buttons";
import MowingHours from "../inputs/MowingHours";
import Inputs from "../inputs/Inputs";

const Step5 = ({
  whichStep,
  setWhichStep,
  setCustomerInputs,
  setPADDRegion,
  customerInputs,
}) => {
  return (
    <div className="container-inputs">
      <div className="coh-container text-main-container">
        <h2>Step 5: Lorem ipsum dolor sit amet</h2>
        <p>
          Etiam at sagittis odio. Vestibulum congue magna ipsum, a tempor mauris
          tempus sed. Donec egestas justo eget metus convallis mollis eget at
          velit. Vestibulum ac porttitor nulla, id bibendum orci. Quisque varius
          elit sapien, at lobortis ex dignissim sed. In eget imperdiet velit.
          Sed lorem ipsum, dapibus in massa vel, tincidunt imperdiet enim.
          Pellentesque habitant morbi tristique senectus et netus et malesuada
          fames ac turpis egestas.
        </p>{" "}
        <ul className="inputs" id="inputs">
          <li className="column center">
            <MowingHours
              {...{
                customerInputs,
                setCustomerInputs,
                inStep: true,
                whichStep,
              }}
            />
          </li>
        </ul>
      </div>
      <Buttons {...{ whichStep, setWhichStep }} />
      <Inputs
        {...{
          whichStep,
          setWhichStep,
          setPADDRegion,
          customerInputs,
          setCustomerInputs,
        }}
      />
    </div>
  );
};

export default Step5;
